To see this quickly, note that in a CYK parse of the length‐18 string, the substring w[1..2] = “t5 t20” must be produced by some nonterminal A via a rule A → B C where B yields “t5” and C yields “t20.”  From the terminal rules we have

 position 1 “t5” ∈ {NT3, NT12, NT15}  
 position 2 “t20” ∈ {NT14, NT16}

We then scan all binary rules A → X Y in the grammar looking for X∈{NT3,NT12,NT15} and Y∈{NT14,NT16}.  No such rule exists, so there is no way to build even the first two terminals.  Hence the full string cannot be generated.  

